import React from 'react';

const SportsList = ({ sports }) => {
  if (sports.length === 0) {
    return <p>No sports available</p>;
  }

  return (
    <ul>
      {sports.map((sport) => (
        <li key={sport.key}>{sport.title}</li>
      ))}
    </ul>
  );
};

export default SportsList;
